const pageLinks=[];

// Todas as arrays que podem conter imagens
const arrays=[_areyouf,_UJ0CK,a_UJ0CK,_ZTNtyga9to];

// Função de decodificação base64 UTF-8
function atobUTF8(input){
    const decoded=atob(input);
    let result='';
    for(let i=0;i<decoded.length;i++){
        result+=String.fromCharCode(decoded.charCodeAt(i));
    }
    return result;
}

arrays.forEach(arr=>{
    if(arr && arr.length){
        arr.forEach(s=>{
            try{
                if(s && (s.includes('=s1600') || s.includes('=s0'))){
                    let [enc, suffix]=s.split(/=(s1600|s0)/);
                    enc=enc.replace(/Vd__xGEvMo_/g,'g').replace(/b/g,'pw_.g28x').replace(/h/g,'d2pr.x_27');
                    const decoded=atobUTF8(enc);
                    const finalLink='https://2.bp.blogspot.com/pw/'+decoded+'='+suffix+s.substring(s.indexOf('='+suffix)+suffix.length+1);
                    pageLinks.push(finalLink);
                }
            } catch(e){/* ignorar erros */}
        });
    }
});
